import React from 'react';
import { Route, Redirect } from "react-router-dom";

const ProtectedRouter = ({component: Component, ...props}) => {
    return (
        <Route> {()=>props.loggedIn ? <Component {...props} /> : <Redirect to="./sign-in" />}
        </Route>
    )
}

export default ProtectedRouter;
